import { useEffect } from "react";

function Cases() {

    useEffect(() => {
        document.title = 'Cases';
    }, []);

    return (
      <section className="section site-portfolio">
        <div className="container">
        <h2 className="cases-header">Cases</h2>
            <div id="portfolio-grid" className="mt-3" data-aos="fade-up" data-aos-delay="200">
            <div className="item web mb-4">
                <a href="" target="_blank" className="item-wrap fancybox">
                    <div class="work-info">
                    <span></span>
                    <p>{item.category}</p>
                    </div>
                    <img className="img-fluid" src={`/cases-images/${item.image}`} alt="" />
                </a>
            </div>
        </div>
        </div>
      </section>
    );
}

export default Cases;
